features.script:
const door = parcel.getFeatureById('nGlassLeft');
const glass = parcel.getFeatureById('nFrameLeft');

const speed = 0.1
const movementRate = 50
const waitTime = 3000
const totalMoves = 20
let closed = true;

door.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})
glass.on('click', (e) => {
  console.log("test")
  if (closed) {
      start(0)
    closed = false  
   }  
})

function start(counter){
  if(counter < totalMoves){
    setTimeout(function(){
      counter++;
      door.position.x += speed
      glass.position.x += speed
      start(counter);
    }, movementRate);
  }
  if(counter == totalMoves) {
    setTimeout(function(){
      goBack(counter)  
    }, waitTime)  

  }
}

function goBack(counter) {
  if(counter > 0){
    setTimeout(function(){
      counter--;
      door.position.x -= speed
      glass.position.x -= speed
      goBack(counter);
    }, movementRate);
  } else {
    closed = true
  }
}
